import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import Img from "./img/1.jpg";
import ImgP from "./img/cake-1.jpeg";
import IconButton from '@material-ui/core/IconButton';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import MoreVertIcon from '@material-ui/icons/MoreVert';

// import { makeStyles } from '@material-ui/core/styles';
// import AppBar from '@material-ui/core/AppBar';
// import Toolbar from '@material-ui/core/Toolbar';
// import Typography from '@material-ui/core/Typography';
// import Button from '@material-ui/core/Button';
// import IconButton from '@material-ui/core/IconButton';
// import MenuIcon from '@material-ui/icons/Menu';

// const useStyles = makeStyles((theme) => ({
//   root: {
//     flexGrow: 1,
//     backgroundColor: theme.palette.background.paper,

   
//   },
//   menuButton: {
//     marginRight: theme.spacing(2),
   
//   },
//   title: {
//     flexGrow: 1,
//   },
 
// }));

// export default function ButtonAppBar() {
//   const classes = useStyles();


const options = [
    'None',
    'Atria',
    'Callisto',
    'Dione',
    'Ganymede',
    'Hangouts Call',
    'Luna',
    'Oberon',
    'Phobos',
    'Pyxis',
    'Sedna',
    'Titania',
    'Triton',
    'Umbriel',
  ];
  
const ITEM_HEIGHT = 48;

const [anchorEl, setAnchorEl] = useState(null);
const open = Boolean(anchorEl);

const handleClick = (event) => {
  setAnchorEl(event.currentTarget);
};

const handleClose = () => {
  setAnchorEl(null);
};

function App1() {
   return (

//     <div className={classes.root}>
//       <AppBar position="static" color="default">
//         <Toolbar>
       
//           <Typography variant="h6" className={classes.title}>
//             LinkdIN
//           </Typography>
//           <Button style={{fontWeight: 'bold'}}>JoinNow</Button>
//           <Button variant="outlined" color="primary" style={{borderRadius: '50px'}}
//           href="#outlined-buttons">Sign in
//           </Button>
//         </Toolbar>  
//       </AppBar>
//     </div>
<>
      
        <div className="Img">
            <img className="img-fluid" style={{width: '100%',height:'200px'}}
            src={Img}
            alt="img"/>
       </div>
       <div className="Img">
            <img className="circle responsive-img" style={{width:'20%', height: '35%',
    borderRadius: '50%',top: '140px',
    position: 'absolute'}}
            src={ImgP}
            alt="Joh Doe"
            />
        </div>


    <div>
      <IconButton
        aria-label="more"
        aria-controls="long-menu"
        aria-haspopup="true"
        onClick={handleClick}
      >
        <MoreVertIcon />
      </IconButton>
      <Menu
        id="long-menu"
        anchorEl={anchorEl}
        keepMounted
        open={open}
        onClose={handleClose}
        PaperProps={{
          style: {
            maxHeight: ITEM_HEIGHT * 4.5,
            width: '20ch',
          },
        }}
      >
        {options.map((option) => (
          <MenuItem key={option} selected={option === 'Pyxis'} onClick={handleClose}>
            {option}
          </MenuItem>
        ))}
      </Menu>
    </div>
        </>
  );
}
export default App1;
